import Layout from '../components/Layout';
import Link from 'next/link';

const Index = () => {
    return (
        <Layout>
            <h2>BOOK REVIEWS AND RECOMMENDATIONS
                VIDEOBOOK SERIES
                PREMIERES
                IN TAMIL

                FOR PROMOTIONS 
                Mail us at queries.almosteverything@gmail.com
                Or DIRECT MESSAGE US ON INSTAGRAM</h2>
            <Link href="/signup">
                <a>Signup</a>
            </Link>
        </Layout>
    );
};

export default Index;
